def equals(self, other):
    self_axes, other_axes = self.axes, other.axes
    if len(self_axes) != len(other_axes):
        return False
    if not all(ax1.equals(ax2) for ax1, ax2 in zip(self_axes, other_axes)):
        return False
    self._consolidate_inplace()
    other._consolidate_inplace()

    if len(self.blocks) != len(other.blocks):
        return False

    # Compare each block in the BlockManager
    for blk in self.blocks:
        if blk._can_hold_identifiers_and_holds_name:
            blk_ids = blk.mgr_locs.as_array.tolist()
            for oblck in other.blocks:
                if oblck._can_hold_identifiers_and_holds_name:
                    if blk.dtype.name == oblck.dtype.name and blk.mgr_locs.as_array.tolist() == blk_ids:
                        if not blk.equals(oblck):
                            return False
                        break

    return True
